import { makeAutoObservable } from "mobx";

interface IRefStore {
  e: React.MouseEventHandler<HTMLButtonElement>;
}

export default class RefStore {
  constructor() {
    makeAutoObservable(this);
  }

  logVerse({ e }: IRefStore) {
    console.log(e);
  }
}
